import React, { useState } from 'react';
import AppLayout from '../components/appLayout';
import Head from 'next/head';
import { Form, Checkbox, Input, Button } from 'antd';

const Signup = () => {
    const [ id, setId ] = useState('');
    const [ nick, setNick ] = useState('');
    const [ password, setPassword ] = useState('');
    const [ passwordCheck, setPasswordCheck ] = useState('');
    const [ term, setTerm ] = useState(false);

    const onSubmit = () => {

    }
    const onChangeId = () => {

    }
    const onChangeNick = () => {

    }
    const onChangePass = () => {

    }
    const onChangePassCheck = () => {

    }
    const onChangeTerm = () => {

    }

    return(
        <>
            <Head>
                <title>Nodebird</title>
                <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.16.2/antd.css" />
            </ Head>
            <AppLayout>
                <Form onSubmit={onSubmit} style={{ padding: 10}} >
                <div>
                    <label htmlFor="user-id" >id</label>
                    <br />
                    <Input name="user-id" required onChange={onChangeId} />
                </div>
                <div>
                    <label htmlFor="user-nick" >nickname</label>
                    <br />
                    <Input name="user-nick" required onChange={onChangeNick} />
                </div>
                <div>
                    <label htmlFor="user-pass">password</label>
                    <br />
                    <Input name="user-pass" type="password" required onchange={onChangePass} />
                </div>
                <div>
                    <label htmlFor="user-pass-check">password-check</label>
                    <br />
                    <Input name="user-pass-check" type="password" required onChange={onChangePassCheck} />
                </div>
                <div>
                    <Checkbox name="user-term" onChange={onChangeTerm} >Are you sure??</Checkbox>
                </div>
                <div>
                    <Button type="primary" htmlType="submit" >Signup</Button>
                </div>
                </Form>
            </AppLayout>
        </>
    )
}

export default Signup;
